			placeholder="Location"
			onChange={(e)=>setLocation(e.target.value)}
            />
    <div>
    <Link to="/about" className="home-btn">Know More<span>
    <FiPlay /></span></Link>
    </div>
    </div>
    
  )
}

export default subscribe
